      SELECT col1 * col0 + - col0 * - col2 AS col2 FROM tab0 (FORMAT parquet) WHERE - + ( + + col0 ) BETWEEN ( - - 69 ) AND + col1 - + col0;
  - name: tab0

outputs:
  - name: q11504.out
    data: |
